              <Route path = "/Homepage" element ={<Homepage/> } />
              <Route path = "/aboutpage" element ={<about/> } />
              <Route path = "/Homepage" element ={<Homepage/> } />

            </Routes>
          </Router>
      </div>


    </div>
  );
}

export default App;
